import React from 'react';
import LogoCarousel from '../components/common/LogoCarousel';
import ContainerNews from '../components/ContainerNews';
import CyberIncidentsStats from '../components/CyberIncidentStats';
import CybersecurityDashboard from '../components/CyberSecurityDashboard';
import PreviewWeb from '../components/sections/PreviewWeb';
import bgvideo from '../assets/videos/bgcyber.mp4';
import Navbar from '../components/common/navbar';
import WebsiteReview from '../components/WebReview';
import CoursesReview from '../components/CoursesReview';
import TestimonialsSection from '../components/CommentReview';
import { motion } from 'framer-motion';


function HomePage() {
  return (
    <div className="min-h-screen bg-gray-900">
      <Navbar />
      
      {/* Hero Section with Video Background */}
      <div className="relative h-[85vh] overflow-hidden">
        {/* Video Background */}
        <div className="absolute inset-0">
          <video 
            className="object-cover w-full h-full"
            autoPlay 
            muted 
            loop
            playsInline
          >
            <source src={bgvideo} type="video/mp4" />
          </video>
          <div className="absolute inset-0 bg-gradient-to-b from-gray-900/70 to-gray-900/90"></div>
        </div>

        {/* Hero Content */}
        <div className="relative z-10 px-6 pt-20 mx-auto max-w-7xl lg:px-8">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            className="max-w-3xl"
          >
            <h1 className="mb-8 text-6xl font-bold leading-tight text-white md:text-7xl">
              Your Informatics<br />
              Student<br />
              Performance<br />
              Center
            </h1>
            
            <p className="mb-12 text-xl leading-relaxed text-gray-300">
              Kita menyediakan platform untuk membuat dan mengembangkan<br />
              Individu atau organisasi Pengembangan Informatika yang berkinerja tinggi.
            </p>

            {/* CTA Buttons */}
            <div className="flex flex-wrap gap-4 mb-16">
              <motion.a
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
                href="testing"
                className="px-8 py-4 bg-[#9FEF00] text-gray-900 font-semibold rounded-lg hover:bg-[#8CD600] transition-colors duration-200"
              >
                Untuk Sekolah
              </motion.a>
              
              <motion.a
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
                href="testing"
                className="px-8 py-4 font-semibold text-white transition-colors duration-200 bg-gray-800 rounded-lg hover:bg-gray-700"
              >
                Untuk Siswa
              </motion.a>
            </div>

            {/* Trial Banner */}
            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.2 }}
              className="inline-flex items-center gap-2 px-6 py-3 rounded-lg bg-gray-800/80 backdrop-blur-sm"
            >
              <span className="px-2 py-1 text-xs font-semibold bg-[#9FEF00] text-gray-900 rounded">NEW</span>
              <span className="text-white">Start a 14-day business trial FOR FREE</span>
              <svg className="w-5 h-5 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
              </svg>
            </motion.div>
          </motion.div>
        </div>
      </div>

      {/* Logo Carousel Section */}
      <div className="py-12 bg-gray-900">
        <div className="px-6 mx-auto max-w-7xl lg:px-8">
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.8 }}
            className="grid items-center grid-cols-3 gap-8 md:grid-cols-6"
          >
            <LogoCarousel />
          </motion.div>
        </div>
      </div>

      {/* News Banner */}
      <div className="bg-gray-900">
        <div className="px-6 py-6 mx-auto max-w-7xl lg:px-8">
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.8 }}
            className="p-6 rounded-lg bg-gray-800/80 backdrop-blur-sm"
          >
            <div className="flex items-center gap-4">
              <img src="/forrester-logo.svg" alt="Forrester" className="h-8" />
              <p className="text-[#9FEF00]">
                RT Academy is a Leader in The Forrester Wave™: Cybersecurity Skills and Training Platforms, Q4 2023
              </p>
              <svg className="w-6 h-6 text-[#9FEF00]" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
              </svg>
            </div>
          </motion.div>
        </div>
      </div>

      {/* Additional Sections */}
      <ContainerNews />
      <CyberIncidentsStats />
      <CybersecurityDashboard />
      <PreviewWeb />
      <WebsiteReview />
      <CoursesReview />
      <TestimonialsSection />
    </div>
  );
}

export default HomePage;
